import React, { Component } from 'react';

class Bottom extends Component {
    render() {
        return (
            <div className="bg-171717 p-rl-30 t-center f-c-737373 p-t-30 p-b-30">
                <p className="text-sm">&copy; Copyright 2022 Eka Prayoga</p>
                <p className="text-sm">Credit : Tim Baker</p>
            </div>
        );
    }
}

export default Bottom;
